import React from "react";
import { ClipLoader, CSSProperties } from "react-spinners/ClipLoader";

const override: CSSProperties = {
  display: "block",
  margin: "0 auto",
  borderColor: "red",
};
const Loader = () => {
  return (
    <div>
      <ClipLoader color="#4bb6b9" size={35} cssOverride={override} />
    </div>
  );
};

export default Loader;
